import React, { useState } from "react";

const Index = () => {
  const [count, setCount] = useState(0);
  return (
    <>
      <h1>Hello world</h1>
      <button>+</button>
      <button>0</button>
      <button>-</button>
    </>
  );
};
export default Index;
